const Projects = () => {
  return (
    <section id="projects" className="py-20 px-6 bg-gray-100">
      <h2 className="text-4xl font-bold text-center mb-10">Projects</h2>

      <div className="grid md:grid-cols-2 gap-6 max-w-5xl mx-auto">
        <div className="bg-white p-6 rounded shadow hover:scale-105 transition">
          <h3 className="text-xl font-bold">Portfolio Website</h3>
          <p className="mt-2">Responsive React portfolio with animations.</p>
        </div>

        <div className="bg-white p-6 rounded shadow hover:scale-105 transition">
          <h3 className="text-xl font-bold">Task Manager App</h3>
          <p className="mt-2">CRUD app using MERN Stack.</p>
        </div>
      </div>
    </section>
  );
};

export default Projects;
